import React from "react";

import LabelReviewsList from "./LabelReviewsList";

const LabelReviewsWrapper = () => {
  return (
    <div className="todoWrapper">
      <div className="sectionHeader"></div>

      <LabelReviewsList />
    </div>
  );
};

export default LabelReviewsWrapper;
